import React from "react";
import { Menu } from 'semantic-ui-react';
import { Link} from "react-router-dom";

export class NavMenu extends React.Component{
    render(){
        return(
            <Menu inverted>
                <Link to="/">
                <Menu.Item
                    name='home'/>
                </Link>
                <Link to="/github">
                <Menu.Item
                    name='github '/>
                </Link>
                <Link to="/counter">
                    <Menu.Item name="counter"/>
                </Link>
                <Link to="/burgers">
                    <Menu.Item name="Burgers"/>
                </Link>
          </Menu>
        )
    }
}
